const styles = (theme) => ({
  tableContainer: {
    width: '100%',
  },
  multiSelectContainer: {
    display: 'flex',
    justifyContent: 'left',
    alignItems: 'flex-start',
    flexWrap: 'wrap',
    marginTop: theme.spacing(2.5),
  },
});

export default styles;
